a:260:{i:0;a:1:{s:2:"id";s:19:"2390913668046671041";}i:1;a:1:{s:10:"short_code";s:11:"CEuO1BAjEzB";}i:2;a:1:{s:12:"created_time";i:1599239141;}i:3;a:1:{s:7:"caption";s:2197:"Sau nhiều lần nấu bò kho không đúng vị mình ưng (thực ra là thất bại), thì Meo đã tìm ra công thức nấu bò kho chuẩn vị và bất bại. Thành công nhất là 2 bạn housemate của Meo (Tây nha) khen ngon (cho dù là khen xã giao thì cũng vui 😆😆😆). 

[Bò kho]
Nguyên liệu:
1kg thịt bò (chọn phần bò sườn, vừa gân vừa mỡ ăn bao ngon, hihi)
5 củ khoai tây
3 củ cà rốt
1-2 củ hành tây (hoặc hành tây tím)
20g xả băm
20g tỏi băm
20g hành tím băm
1 lon nước cốt dừa
2 thìa gia vị nấu bò kho
Hành lá
Ngò

Cách chế biến:
(Đây là cách Meo nấu theo khẩu vị nhạt, không ăn kèm bánh, bún, mì gì cả, mọi người thích ăn kèm thì thêm gia vị theo ý thích)
- Để bò không bị hôi ngai ngái thì nên trụng bò qua nước sôi từ 1-2 lần.
- Cắt bò theo khối hình vuông tầm 1,5-2cm. 
- Ướp bò 2 thìa gia vị bò kho, nửa thìa ngũ vị hương, 1 thìa muối, 2 thìa đường, 2 thìa dầu hào, 3 thìa nước mắm, 2 thìa hạt nêm, 1 thìa tiêu xay, 1 thìa bột ớt, nửa thìa mì chính. (Thìa ăn cơm bình thường) 
Ướp thịt bò tầm 30p-1 tiếng, nếu muốn ngon và đậm đà thì để tủ lạnh ướp 12 tiếng (đảm bảo siêu ngon). 
- Khoai tây, cà rốt, hành tây cắt khối vuông như thịt bò. 

Cách nấu:
- Dùng nồi gang, cho ít dầu ăn đợi sôi thì cho hết bò đã ướp đảo tầm 3-5p, đảm bảo tất cả các mặt của bò đều đã chín. Sau đó cho hết lon nước cốt dừa vào đảo chung, nêm thêm 1 thìa đường. 
- Lúc sôi trở lại thì đổ tầm 700ml-1L nước (tuỳ thuộc vào mọi người chuẩn bị bao nhiêu rau củ). Hầm 1-1h30, nhớ canh đảo. 
- Sau đó nêm nước và nêm lại gia vị theo ý thích. Rồi bỏ cà rốt hầm, sau 15p bỏ khoai tây và sau 15p bỏ hành tây. Đợi 5p, tắt bếp và hoàn thành 👏🏻👏🏻👏🏻

Múc ra tô, trang trí ít hành lá và ngò nếu thích 😊 

